import React from 'react'

const EmployeeList = (props) => {
    const {empData} = props;
    console.log(empData)

  return (
    <div>
      {
        empData.map((data, index) => {
            <li key={index}>{data.full}</li>
        })
      }
    </div>
  )
}

export default EmployeeList
